import './App.css';
import { ChakraProvider,Box ,Container,Flex,CSSReset} from '@chakra-ui/react'
import { } from '@chakra-ui/icons'
import Navbar from './components/navBar';
import SideBar from './components/leftSideBar';


function App() {
  return (
    <ChakraProvider>
      <CSSReset />
      <Box>
        <Navbar />
      </Box>
      <Box  mt="4" bgColor='red' display='flex' w='200px'>
         Hihi
      </Box>
    </ChakraProvider>
  );
}

export default App;
